import React, { useEffect, useRef, useState } from 'react';
import CytoscapeComponent from 'react-cytoscapejs';
import cytoscape from 'cytoscape';
import cola from 'cytoscape-cola';
import { apiUrl } from '../config';
import '../styles/NetworkGraph.css';

// Define colors as constants
const COLORS = {
  node: '#CC4A04',     // Default node color (Cayenne orange)
  prefix: '#002921',   // Color for all prefix nodes
  text: '#000',        // Black
  edge: '#1a365d'      // Blue
};

// Register the cola layout
cytoscape.use(cola);

const Legend = () => (
  <div className="graph-legend">
    <h3>Legend</h3>
    <div className="legend-item">
      <span className="legend-color" style={{ backgroundColor: COLORS.node }}></span>
      <span>Network Nodes</span>
    </div>
    <div className="legend-item">
      <span className="legend-color" style={{ backgroundColor: COLORS.prefix }}></span>
      <span>Prefix Nodes</span>
    </div>
  </div>
);

const NetworkGraph = ({ collection }) => {
  const cyRef = useRef(null);
  const [graphData, setGraphData] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    const loadGraphData = async () => {
      if (!collection) return;

      setIsLoading(true);
      setError(null);

      try {
        console.log('Fetching from:', `${apiUrl}/api/v1/collections/${collection}/edges`);
        const response = await fetch(`${apiUrl}/api/v1/collections/${collection}/edges`);

        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }

        const data = await response.json();
        console.log('Received data:', data);

        const elements = transformDataToCytoscape(data);
        setGraphData(elements);
      } catch (err) {
        console.error('Detailed error:', err);
        setError(`Failed to load graph data: ${err.message}`);
      } finally {
        setIsLoading(false);
      }
    };

    loadGraphData();
  }, [collection]);

  const transformDataToCytoscape = (data) => {
    const elements = {
      nodes: new Set(),
      edges: new Set() // Changed to Set for deduplication
    };

    if (!data) return [];
    const edgesData = Array.isArray(data) ? data : data.edges || data.data || [];

    // Create a helper function to generate a consistent edge ID
    const getEdgeId = (from, to) => {
      // Sort the nodes to ensure consistent ID regardless of direction
      const nodes = [from, to].sort();
      return `${nodes[0]}-${nodes[1]}`;
    };

    edgesData.forEach(item => {
      if (item._from && item._to) {
        // Add nodes
        elements.nodes.add({
          data: {
            id: item._from,
            label: item._from.split('/')[1],
            type: item._from.split('/')[0]
          }
        });

        elements.nodes.add({
          data: {
            id: item._to,
            label: item._to.split('/')[1],
            type: item._to.split('/')[0]
          }
        });

        // Add edge (only one direction)
        const edgeId = getEdgeId(item._from, item._to);
        elements.edges.add({
          data: {
            id: edgeId,
            source: item._from,
            target: item._to
          }
        });
      }
    });

    return [...Array.from(elements.nodes), ...Array.from(elements.edges)];
  };

  const layout = {
    name: 'cola',
    animate: true,
    refresh: 1,
    maxSimulationTime: 3000,
    nodeSpacing: 100,
    edgeLength: 200,
    randomize: true,
    infinite: true
  };

  const stylesheet = [
    {
      selector: 'node',
      style: {
        'background-color': (ele) => {
          const nodeType = ele.data('type');
          return nodeType.includes('prefix') ? COLORS.prefix : COLORS.node;
        },
        'label': 'data(label)',
        'width': 30,
        'height': 30,
        'color': COLORS.text,
        'text-outline-width': 2,
        'text-outline-color': '#fff',
        'font-family': 'Consolas',
        'font-size': '10px',
        'text-wrap': 'wrap',
        'text-max-width': '100px'
      }
    },
    {
      selector: 'edge',
      style: {
        'width': 1.5,
        'line-color': COLORS.edge,
        'curve-style': 'bezier',
        'target-arrow-color': COLORS.edge,
        'target-arrow-shape': 'triangle',
        'arrow-scale': 0.8
      }
    }
  ];

  if (isLoading) {
    return <div style={{ padding: '20px', fontFamily: 'Consolas' }}>Loading graph data...</div>;
  }

  if (error) {
    return <div style={{ padding: '20px', color: 'red', fontFamily: 'Consolas' }}>{error}</div>;
  }

  if (!graphData) {
    return <div style={{ padding: '20px', fontFamily: 'Consolas' }}>Select a graph to visualize</div>;
  }

  return (
    <div className="network-graph-container">
      <Legend />
      <div className="graph-area">
        <CytoscapeComponent
          elements={graphData}
          layout={layout}
          stylesheet={stylesheet}
          cy={(cy) => { cyRef.current = cy; }}
          style={{ width: '100%', height: '100%' }}
        />
      </div>
    </div>
  );
};

export default NetworkGraph;
